import React from "react";
import { useNavigation } from "react-router-dom";

const PrivateRoute = ({ user, children }) => {
  const { name } = user;
  const Navigate = useNavigation;
  if (!name) {
    return <Navigate to="/signin" replace />;
  }

  return children;
};

export default PrivateRoute;
